/* eslint-disable react/button-has-type */
/* eslint-disable no-dupe-else-if */
import React from 'react';
import PropTypes from 'prop-types';
import { useNavigate } from 'react-router-dom';
import { TfiComment } from 'react-icons/tfi';
import { AiOutlineLike, AiOutlineDislike } from 'react-icons/ai';
import { postedAt } from '../utils/index';
import parse from 'html-react-parser';

function ThreadItem({
  id,
  title,
  body,
  category,
  createdAt,
  upVotesBy,
  downVotesBy,
  totalComments,
  user,
  authUser,
  like,
  dislike,
  neutralLike,
  neutralDislike,
}) {
  const navigate = useNavigate();
  const isThreadLiked = upVotesBy.includes(authUser);
  const isThreadDisliked = downVotesBy.includes(authUser);

  const onLikeClick = (event) => {
    event.stopPropagation();
    if (!isThreadLiked && !isThreadLiked) {
      like(id);
    } else if (isThreadLiked) {
      neutralDislike(id);
      like(id);
    } else if (isThreadLiked) {
      neutralLike(id);
    }
  };

  const onDislikeClick = (event) => {
    event.stopPropagation();
    if (!isThreadLiked && !isThreadLiked) {
      like(id);
    } else if (isThreadLiked) {
      neutralLike(id);
      dislike(id);
    } else if (isThreadLiked) {
      neutralLike(id);
    }
  };

  const onThreadClick = () => {
    navigate(`/threads/${id}`);
  };

  const onThreadPress = (event) => {
    if (event.key === 'Enter' || event.key === ' ') {
      navigate(`/talks/${id}`);
    }
  };

  return (
    <div role="button" tabIndex={0} onKeyDown={onThreadPress} onClick={onThreadClick} className="thread-item">
      <div className="thread-item__user-avatar">
        <img src={user.avatar} alt={user.name} />
      </div>
      <div className="thread-item__detail">
        <header>
          <div>
            <p>{user.name}</p>
            <p>{postedAt(createdAt)}</p>
          </div>
        </header>
        <article>
          <p>{title}</p>
          <p>{`# ${category}`}</p>
          <div>{body}</div>
        </article>
        <div>
          <p>
            <button type="button" onClick={onLikeClick}>
              {isThreadLiked ? (
                <AiOutlineLike style={{ color: 'blue' }} />
              ) : (
                <AiOutlineLike />
              )}
            </button>
            {isThreadLiked ? (
              <span style={{ color: 'green' }}>{upVotesBy.length}</span>
            ) : (
              <span>{upVotesBy.length}</span>
            )}
          </p>

          <p>
            <button type="button" onClick={onDislikeClick}>
              {isThreadDisliked ? (
                <AiOutlineDislike style={{ color: 'red' }} />
              ) : (
                <AiOutlineDislike />
              )}
              {isThreadDisliked ? (
                <span style={{ color: 'green' }}>{downVotesBy.length}</span>
              ) : (
                <span>{downVotesBy.length}</span>
              )}
            </button>
          </p>
          <p>
            <button href="/detail-thread">
              <TfiComment />
            </button>
            {totalComments}
          </p>
        </div>
      </div>
    </div>
  );
}

const userShape = {
  id: PropTypes.string.isRequired,
  name: PropTypes.string.isRequired,
  email: PropTypes.string.isRequired,
  avatar: PropTypes.string.isRequired,
};

const threadItemShape = {
  id: PropTypes.string.isRequired,
  title: PropTypes.string.isRequired,
  body: PropTypes.string.isRequired,
  category: PropTypes.string.isRequired,
  createdAt: PropTypes.string.isRequired,
  upVotesBy: PropTypes.arrayOf(PropTypes.string).isRequired,
  downVotesBy: PropTypes.arrayOf(PropTypes.string).isRequired,
  totalComments: PropTypes.number.isRequired,
  user: PropTypes.shape(userShape).isRequired,
  authUser: PropTypes.string.isRequired,
};

ThreadItem.propTypes = {
  ...threadItemShape,
  like: PropTypes.func,
  dislike: PropTypes.func,
  neutralLike: PropTypes.func,
  neutralDislike: PropTypes.func,
};

ThreadItem.defaultProps = {
  like: null,
  dislike: null,
  neutralDislike: null,
  neutralLike: null,
};

export { threadItemShape };

export default ThreadItem;
